import React from 'react'
import * as appStyle from './appStyle'
import Header from './header/header'

class App extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <appStyle.AppWrap>
                <Header/>
            </appStyle.AppWrap>
        )
    }
}

export default App
